import React, { useState } from 'react';
import './ProductPage.css';

const ProductPage = ({ product }) => {
    const [selectedImage, setSelectedImage] = useState(product.images[0]);
    const [quantity, setQuantity] = useState(1);

    const handleImageClick = (image) => {
        setSelectedImage(image);
    };

    const handleQuantityChange = (e) => {
        setQuantity(e.target.value);
    };

    const addToCart = () => {
        // Implement add to cart functionality
        console.log(`Added ${quantity} of ${product.name} to cart.`);
    };

    const buyNow = () => {
        // Implement buy now functionality
        console.log(`Buying ${quantity} of ${product.name}.`);
    };

    return (
        <div className="product-page">
            <div className="product-images">
                <img src={selectedImage} alt={product.name} className="main-image" />
                <div className="image-gallery">
                    {product.images.map((image, index) => (
                        <img
                            key={index}
                            src={image}
                            alt={`${product.name} ${index + 1}`}
                            onClick={() => handleImageClick(image)}
                            className={image === selectedImage ? 'selected' : ''}
                        />
                    ))}
                </div>
            </div>
            <div className="product-details">
                <h1>{product.name}</h1>
                <p className="product-price">${product.price.toFixed(2)}</p>
                <p className="product-description">{product.description}</p>
                <div className="purchase-options">
                    <label htmlFor="quantity">Quantity:</label>
                    <input
                        type="number"
                        id="quantity"
                        value={quantity}
                        onChange={handleQuantityChange}
                        min="1"
                    />
                    <button onClick={addToCart} className="add-to-cart-btn">Add to Cart</button>
                    <button onClick={buyNow} className="buy-now-btn">Buy Now</button>
                </div>
                <div className="product-specifications">
                    <h3>Specifications</h3>
                    <p>{product.specifications}</p>
                </div>
                <div className="vendor-info">
                    <h4>Sold by: {product.vendor.name}</h4>
                    <p>Contact: {product.vendor.contact}</p>
                </div>
            </div>
            <div className="related-products">
                <h3>Related Products</h3>
                <ul>
                    {product.relatedProducts.map((relatedProduct, index) => (
                        <li key={index}>{relatedProduct.name}</li>
                    ))}
                </ul>
            </div>
            <div className="customer-reviews">
                <h3>Customer Reviews</h3>
                <div className="review-summary">
                    <p>Average Rating: {product.averageRating}</p>
                    <p>{product.reviews.length} Reviews</p>
                </div>
                <div className="reviews">
                    {product.reviews.map((review, index) => (
                        <div key={index} className="review">
                            <p><strong>{review.user}</strong> ({review.rating} stars)</p>
                            <p>{review.comment}</p>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default ProductPage;
